import { Box } from '@mui/system'
import React from 'react'

const ImageCarousel = () => {
  return (
    <Box
    sx={{
      width: "100%",
      height: 300,
      backgroundColor: 'red'
    }}
  />
  )
}

export default ImageCarousel
